import React from 'react';
import Box from '@mui/material/Box';

const CustomBox = ({ width, height, bgcolor, color, marginTop, marginBottom, children, paddingTop, paddingBottom, paddingLeft, paddingRight, style, font }) => {
  const boxStyles = {
    width: width || 'auto',
    height: height || 'auto',
    backgroundColor: bgcolor || '#36545d',
    color: color || 'white',
    marginTop: marginTop || 10,
    marginBottom: marginBottom || 3,
    marginLeft: '120px',
    borderRadius: '30px',
    paddingTop: paddingTop || '20px', // Customize top padding here
    paddingBottom: paddingBottom || '20px', // Customize bottom padding here
    paddingLeft: paddingLeft || '20px', // Customize left padding here
    paddingRight: paddingRight || '20px', // Customize right padding here
    fontSize: font || '20px',
    ...style,
  };

  return (
    <Box sx={boxStyles}>
      {children}
    </Box>
  );
};

export default CustomBox;
